import React from "react";
import {
  Container,
  Button,
  Mobimage,
  Dimage,
  ImagesBottom
} from "./HeroElements";
import logo from "../../assets/images/logo/stessis_original.svg";
import logotwo from "../../assets/images/logo/stessis_white.png";

function Hero() {
  return (
    <Container>
      <div className="rows">
        <div className="leftside">
          <Dimage>
            <img src={logo} alt="Stessis Logo" width="250px" />
          </Dimage>
          <Mobimage>
            <img src={logotwo} alt="Stessis Logo" width="250px" />
          </Mobimage>
          <h2>Outstanding medical Artificial Intelligence technology</h2>
          <Button>GET STARTED</Button>
          <ImagesBottom>
            <img src={logo} alt="Stessis Logo" width="250px" />
          </ImagesBottom>
        </div>
        <div className="rightside"></div>
      </div>
    </Container>
  );
}

export default Hero;
